import React from "react";
import "./Loader.css";
import distance from "./assets/distance.svg"

export default function Loader(){
	return(
		<>
		<div>
			<img alt="" style={{width: "250px", height: "auto"}} src={distance}/>
		</div>
		</>
		);
}
